export default class Utils {
    static random(max) {
        max = Math.floor(max);
        return Math.floor(Math.random() * (max + 1));
    }

    static randomCoords(max) {
        return [Utils.random(max), Utils.random(max)];
    }

    static beep() {
        let snd = new Audio("data:audio/wav;base64,");
        snd.play();
    }

    static boom() {
        let snd = new Audio("data:audio/wav;base64,");
        snd.play();
    }

    static boom2() {
        let snd = new Audio("data:audio/wav;base64,");
        snd.play();
    }

    static randomArrEl(arr) {
        if (arr.length) {
            return arr[Utils.random(arr.length - 1)];
        }
        else {
            console.error('Array is empty!');
            return [];
        }
    }
}

